entry u22_pot_8(xyz,v, dxyz)

r12=sqrt((xyz(1,1)-xyz(2,1))**2+(xyz(1,2)-xyz(2,2))**2+(xyz(1,3)-xyz(2,3))**2)
r13=sqrt((xyz(1,1)-xyz(3,1))**2+(xyz(1,2)-xyz(3,2))**2+(xyz(1,3)-xyz(3,3))**2)
r14=sqrt((xyz(1,1)-xyz(4,1))**2+(xyz(1,2)-xyz(4,2))**2+(xyz(1,3)-xyz(4,3))**2)
r23=sqrt((xyz(2,1)-xyz(3,1))**2+(xyz(2,2)-xyz(3,2))**2+(xyz(2,3)-xyz(3,3))**2)
r24=sqrt((xyz(2,1)-xyz(4,1))**2+(xyz(2,2)-xyz(4,2))**2+(xyz(2,3)-xyz(4,3))**2)
r34=sqrt((xyz(3,1)-xyz(4,1))**2+(xyz(3,2)-xyz(4,2))**2+(xyz(3,3)-xyz(4,3))**2)

re_hh = 0.741
re_oh = 0.970

ra_hh=ra1
ra_oh=ra2
rb_hh=rb1
rb_oh=rb2


x(1)=exp(-((r12-ra1))/a1 -((r12-rb1)**2)/b1)
x(2)=exp(-((r13-ra1))/a1 -((r13-rb1)**2)/b1)
x(3)=exp(-((r14-ra2))/a2 -((r14-rb2)**2)/b2)
x(4)=exp(-((r23-ra1))/a1 -((r23-rb1)**2)/b1)
x(5)=exp(-((r24-ra2))/a2 -((r24-rb2)**2)/b2)
x(6)=exp(-((r34-ra2))/a2 -((r34-rb2)**2)/b2)
call ev_pol_con_8(x,p) 
v=dot_product(coeff,p)  +((oh(r14)+oh(r24)+oh(r34))*0.9960924723525706+hh(r12)+hh(r13)+hh(r23))


call grad_ev_pol_con_8(x,dpdx1,dpdx2,dpdx3,dpdx4,dpdx5,dpdx6)

dx1 = dot_product(coeff,dpdx1)
dx2 = dot_product(coeff,dpdx2)
dx3 = dot_product(coeff,dpdx3)
dx4 = dot_product(coeff,dpdx4)
dx5 = dot_product(coeff,dpdx5)
dx6 = dot_product(coeff,dpdx6)

dr1=-x(1)*(1.0d0/(a1)+2.0d0*(r12-rb1)/(b1))*dx1 + grad_hh(r12)
dr2=-x(2)*(1.0d0/(a1)+2.0d0*(r13-rb1)/(b1))*dx2 + grad_hh(r13)
dr3=-x(3)*(1.0d0/(a2)+2.0d0*(r14-rb2)/(b2))*dx3 + grad_oh(r14)*0.9960924723525706
dr4=-x(4)*(1.0d0/(a1)+2.0d0*(r23-rb1)/(b1))*dx4 + grad_hh(r23)
dr5=-x(5)*(1.0d0/(a2)+2.0d0*(r24-rb2)/(b2))*dx5 + grad_oh(r24)*0.9960924723525706
dr6=-x(6)*(1.0d0/(a2)+2.0d0*(r34-rb2)/(b2))*dx6 + grad_oh(r34)*0.9960924723525706

dxyz(1,1)=dr1/r12*(xyz(1,1)-xyz(2,1))+dr2/r13*(xyz(1,1)-xyz(3,1))+dr3/r14*(xyz(1,1)-xyz(4,1))
dxyz(1,2)=dr1/r12*(xyz(1,2)-xyz(2,2))+dr2/r13*(xyz(1,2)-xyz(3,2))+dr3/r14*(xyz(1,2)-xyz(4,2))
dxyz(1,3)=dr1/r12*(xyz(1,3)-xyz(2,3))+dr2/r13*(xyz(1,3)-xyz(3,3))+dr3/r14*(xyz(1,3)-xyz(4,3))

dxyz(2,1)=-dr1/r12*(xyz(1,1)-xyz(2,1))+dr4/r23*(xyz(2,1)-xyz(3,1))+dr5/r24*(xyz(2,1)-xyz(4,1))
dxyz(2,2)=-dr1/r12*(xyz(1,2)-xyz(2,2))+dr4/r23*(xyz(2,2)-xyz(3,2))+dr5/r24*(xyz(2,2)-xyz(4,2))
dxyz(2,3)=-dr1/r12*(xyz(1,3)-xyz(2,3))+dr4/r23*(xyz(2,3)-xyz(3,3))+dr5/r24*(xyz(2,3)-xyz(4,3))

dxyz(3,1)=-dr2/r13*(xyz(1,1)-xyz(3,1))-dr4/r23*(xyz(2,1)-xyz(3,1))+dr6/r34*(xyz(3,1)-xyz(4,1))
dxyz(3,2)=-dr2/r13*(xyz(1,2)-xyz(3,2))-dr4/r23*(xyz(2,2)-xyz(3,2))+dr6/r34*(xyz(3,2)-xyz(4,2))
dxyz(3,3)=-dr2/r13*(xyz(1,3)-xyz(3,3))-dr4/r23*(xyz(2,3)-xyz(3,3))+dr6/r34*(xyz(3,3)-xyz(4,3))

dxyz(4,1)=-dr3/r14*(xyz(1,1)-xyz(4,1))-dr5/r24*(xyz(2,1)-xyz(4,1))-dr6/r34*(xyz(3,1)-xyz(4,1))
dxyz(4,2)=-dr3/r14*(xyz(1,2)-xyz(4,2))-dr5/r24*(xyz(2,2)-xyz(4,2))-dr6/r34*(xyz(3,2)-xyz(4,2))
dxyz(4,3)=-dr3/r14*(xyz(1,3)-xyz(4,3))-dr5/r24*(xyz(2,3)-xyz(4,3))-dr6/r34*(xyz(3,3)-xyz(4,3))

return
end  subroutine

