real*8 function ohstar(r)
implicit none
real*8, intent(in) :: r
integer :: i
real*8 :: alr, blr, vsr, vlr, fs
real*8, dimension(3) :: plr, clr
real*8 :: asr, bsr
real*8, dimension(6) :: psr, csr


alr = 2.0991414262152035
blr = 0.55368872045847861
clr(1) = 4.8925016098582264
clr(2) = -0.25648455026027650
clr(3) = 0.19261955256047161

do i = 1, 3
    plr(i) = exp(-alr*blr**(i-1)*r**2)
end do

vlr = dot_product(clr, plr)

asr = 0.22510201499513907
bsr = 2.2657615066074954

csr(1) = 0.35455513969718444    
csr(2) = -0.52912871421810181     
csr(3) = -6.0697181582250126E-002
csr(4) = 0.47976112924154690     
csr(5) = 2.3310416022954366     
csr(6) = 5.6903894590457540

do i = 1, 6
    psr(i) = exp(-asr*bsr**(i-1)*r**2)
end do

vsr = dot_product(csr, psr)

fs = 0.5*(1.0 - tanh(10.0*(r-1.577)))

ohstar = fs*vsr + (1.0 - fs)*vlr

end function ohstar

real*8 function grad_ohstar(r)
implicit none
real*8, intent(in) :: r
integer :: i
real*8 :: alr, blr, vsr, vlr, fs, gsr, glr, gfs
real*8, dimension(3) :: plr, clr, pglr
real*8 :: asr, bsr
real*8, dimension(6) :: psr, csr, pgsr


alr = 2.0991414262152035
blr = 0.55368872045847861
clr(1) = 4.8925016098582264
clr(2) = -0.25648455026027650
clr(3) = 0.19261955256047161

do i = 1, 3
    plr(i) = exp(-alr*blr**(i-1)*r**2)
    pglr(i) = -2.0*alr*blr**(i-1)*r*exp(-alr*blr**(i-1)*r**2)
end do

vlr = dot_product(clr, plr)
glr = dot_product(clr, pglr)

asr = 0.22510201499513907
bsr = 2.2657615066074954

csr(1) = 0.35455513969718444    
csr(2) = -0.52912871421810181     
csr(3) = -6.0697181582250126E-002
csr(4) = 0.47976112924154690     
csr(5) = 2.3310416022954366     
csr(6) = 5.6903894590457540

do i = 1, 6
    psr(i) = exp(-asr*bsr**(i-1)*r**2)
    pgsr(i) = -2.0*asr*bsr**(i-1)*r*exp(-asr*bsr**(i-1)*r**2)
end do

vsr = dot_product(csr, psr)
gsr = dot_product(csr, pgsr)

fs = 0.5*(1.0 - tanh(10.0*(r-1.577)))
gfs = -0.5*10.0/(cosh(10.0*(r-1.577)))**2

grad_ohstar = gfs*(vsr - vlr) + fs*gsr + (1.0 - fs)*glr

end function grad_ohstar

