!===========================================================================
! *def EvdRdX(coord,r,dvdr)
!  subtoutine of evaluating derivative of 6 nuclear distances w.r.t. xyz 
!  coord is the xyz coordinate 
!  r is the nuclear distances
!  drdx is the derivative of 6 nuclear distances w.r.t. xyz 
!===========================================================================
subroutine EvdRdX(coord,r,drdx)
real*8 :: coord(12),r(6),drdx(6,12)

! Start to calculate the non-zero dRdX
! dr1dx
      dRdX(1,1)=(coord(1)-coord(4))/r(1)
      dRdX(1,2)=(coord(2)-coord(5))/r(1)
      dRdX(1,3)=(coord(3)-coord(6))/r(1)
      dRdX(1,4)=-dRdX(1,1)
      dRdX(1,5)=-dRdX(1,2)
      dRdX(1,6)=-dRdX(1,3)

! dr2dx
      dRdX(2,1)=(coord(1)-coord(7))/r(2)
      dRdX(2,2)=(coord(2)-coord(8))/r(2)
      dRdX(2,3)=(coord(3)-coord(9))/r(2)
      dRdX(2,7)=-dRdX(2,1)
      dRdX(2,8)=-dRdX(2,2)
      dRdX(2,9)=-dRdX(2,3)

! dr3dx
      dRdX(3,1)=(coord(1)-coord(10))/r(3)
      dRdX(3,2)=(coord(2)-coord(11))/r(3)
      dRdX(3,3)=(coord(3)-coord(12))/r(3)
      dRdX(3,10)=-dRdX(3,1)
      dRdX(3,11)=-dRdX(3,2)
      dRdX(3,12)=-dRdX(3,3)

! dr4dx
      dRdX(4,4)=(coord(4)-coord(7))/r(4)
      dRdX(4,5)=(coord(5)-coord(8))/r(4)
      dRdX(4,6)=(coord(6)-coord(9))/r(4)
      dRdX(4,7)=-dRdX(4,4)
      dRdX(4,8)=-dRdX(4,5)
      dRdX(4,9)=-dRdX(4,6)

! dr5dx
      dRdX(5,4)=(coord(4)-coord(10))/r(5)
      dRdX(5,5)=(coord(5)-coord(11))/r(5)
      dRdX(5,6)=(coord(6)-coord(12))/r(5)
      dRdX(5,10)=-dRdX(5,4)
      dRdX(5,11)=-dRdX(5,5)
      dRdX(5,12)=-dRdX(5,6)

! dr6dx
      dRdX(6,7)=(coord(7)-coord(10))/r(6)
      dRdX(6,8)=(coord(8)-coord(11))/r(6)
      dRdX(6,9)=(coord(9)-coord(12))/r(6)
      dRdX(6,10)=-dRdX(6,7)
      dRdX(6,11)=-dRdX(6,8)
      dRdX(6,12)=-dRdX(6,9)
! Finish the calculation of non-zero dRdX

      return

end subroutine EvdRdX

!===========================================================================
! *def Num_dtdx(xyz,dtdx)
!  subtoutine of evaluating derivative of hyperbolic function
!  coord is the xyz coordinate 
!  dtdx is the derivative of hyperbolic function
!===========================================================================
subroutine Num_dtdx(xyz,dtdx)
implicit none
integer :: i,j,k,m,n
real*8 :: xyz(4,3)
real*8 :: dtdx(12)
real*8 :: xyz1(4,3), xyz2(4,3)
real*8 :: volume1, volume2

  do i=1,12
    dtdx(i)=0.000
  enddo

  do i=1,4
  do j=1,3
    do m=1,4
    do n=1,3
      xyz1(m,n)=xyz(m,n)
      xyz2(m,n)=xyz(m,n)
    enddo
    enddo
    k=(i-1)*3+j
    xyz1(i,j)=xyz(i,j)+0.001
    call P_volume(xyz1,volume1)
    xyz2(i,j)=xyz(i,j)-0.001
    call P_volume(xyz2,volume2)
    dtdx(k)=(volume1-volume2)/0.002
  enddo
  enddo
end subroutine Num_dtdx

!===========================================================================
! *def P_volume(xyz,volume) 
!  subtoutine of evaluating hyperbolic function
!  coord is the xyz coordinate 
!  volume is the hyperbolic function
!===========================================================================
subroutine P_volume(xyz,volume)
implicit none
integer :: i,j,k
real*8 :: volume
real*8 :: xyz(4,3)
real*8 :: rrel(3,3),cross(3)
  volume=0.0000
  do i=1,3
  do j=1,3
    rrel(i,j)=xyz(i,j)-xyz(4,j)
  enddo
  enddo
  cross(1)=rrel(2,2)*rrel(3,3)-rrel(2,3)*rrel(3,2)
  cross(2)=-rrel(2,1)*rrel(3,3)+rrel(2,3)*rrel(3,1)
  cross(3)=rrel(2,1)*rrel(3,2)-rrel(2,2)*rrel(3,1)
  do i=1,3
    volume=volume+rrel(1,i)*cross(i)
  enddo
  volume=tanh(15.4*volume)
end subroutine P_volume
!===========================================================================
! *def u13_dvdx(xyz,u13,du13dx)
!  main subtoutine of evaluating derivative of u13 w.r.t. the xyz coordinates
!  xyz is the coordinate
!  u13 is u13
!  du13dx is the gradient of u13
!===========================================================================
subroutine u13_dvdx(xyz,u13,du13dx)
implicit none
integer :: i,j,k
real*8 :: du13dx(4,3),xyz(4,3)
real*8 :: u13
real*8 :: coord(12), r(6)
real*8 :: dudx(12)
real*8 :: dvdx(12), dvdr(6), drdx(6,12)
real*8 :: volume

! Initialize dVdX(12)
      do i=1,12
        dVdX(i)=0.0d0
      enddo

! Initialize dRdX(6,12)
      do i=1,6
        do j=1,12
          dRdX(i,j)=0.0d0
        enddo
      enddo

! Initialize dVdR(6)
      do i=1,6
        dVdR(i)=0.0d0
      enddo

! Assign xyz to coord
      do i=1,4
      do j=1,3
        k=3*(i-1)+j
        coord(k)=xyz(i,j)
      enddo
      enddo

! Compute distances r
r(1)=sqrt((xyz(1,1)-xyz(2,1))**2+(xyz(1,2)-xyz(2,2))**2+(xyz(1,3)-xyz(2,3))**2)
r(2)=sqrt((xyz(1,1)-xyz(3,1))**2+(xyz(1,2)-xyz(3,2))**2+(xyz(1,3)-xyz(3,3))**2)
r(3)=sqrt((xyz(1,1)-xyz(4,1))**2+(xyz(1,2)-xyz(4,2))**2+(xyz(1,3)-xyz(4,3))**2)
r(4)=sqrt((xyz(2,1)-xyz(3,1))**2+(xyz(2,2)-xyz(3,2))**2+(xyz(2,3)-xyz(3,3))**2)
r(5)=sqrt((xyz(2,1)-xyz(4,1))**2+(xyz(2,2)-xyz(4,2))**2+(xyz(2,3)-xyz(4,3))**2)
r(6)=sqrt((xyz(3,1)-xyz(4,1))**2+(xyz(3,2)-xyz(4,2))**2+(xyz(3,3)-xyz(4,3))**2)

! Call EvdVdR to evaluate dVdR(6)
      Call EvU13O10dVdR(coord,r,dvdr)

! Call EvdRdX to evaluate dRdX(6,12)
      Call EvdRdX(coord,r,drdx)

! Calculate dVdX by using chain rule: dV/dXi=(dV/dRj)*(dRj/dXi), j=1 to 6
      do i=1,12
        do j=1,6
          dVdX(i)=dVdX(i) + dVdR(j)*dRdX(j,i)
        enddo
      enddo

      do i=1,12
        dudx(i)=dvdx(i)/627.509474
      enddo

! Assign dvdx back to du13dvdx
      do i=1,4
      do j=1,3
        k=3*(i-1)+j
        du13dx(i,j)=dudx(k)
      enddo
      enddo

      return

end subroutine u13_dvdx 

