!===========================================================================
! *def u23_dvdx(xyz,u23,s23,du23dx)
!  main subtoutine of evaluating derivative of u23 w.r.t. the xyz coordinates
!  xyz is the coordinate
!  u23 is u23
!  s23 is u23 devided by the hyperbolic function
!  du23dx is the gradient of u23
!===========================================================================
subroutine u23_dvdx(xyz,u23,s23,du23dx)
implicit none
integer :: i,j,k
real*8 :: du23dx(4,3),xyz(4,3)
real*8 :: u23,s23
real*8 :: coord(12), r(6)
real*8 :: dudx(12)
real*8 :: dvdx(12), dvdr(6), drdx(6,12)
real*8 :: dtdx(12)
real*8 :: volume

! Initialize dVdX(12)
      do i=1,12
        dVdX(i)=0.0d0
      enddo

! Initialize dRdX(6,12)
      do i=1,6
        do j=1,12
          dRdX(i,j)=0.0d0
        enddo
      enddo

! Initialize dVdR(6)
      do i=1,6
        dVdR(i)=0.0d0
      enddo

! Assign xyz to coord
      do i=1,4
      do j=1,3
        k=3*(i-1)+j
        coord(k)=xyz(i,j)
      enddo
      enddo

! Compute distances r
r(1)=sqrt((xyz(1,1)-xyz(2,1))**2+(xyz(1,2)-xyz(2,2))**2+(xyz(1,3)-xyz(2,3))**2)
r(2)=sqrt((xyz(1,1)-xyz(3,1))**2+(xyz(1,2)-xyz(3,2))**2+(xyz(1,3)-xyz(3,3))**2)
r(3)=sqrt((xyz(1,1)-xyz(4,1))**2+(xyz(1,2)-xyz(4,2))**2+(xyz(1,3)-xyz(4,3))**2)
r(4)=sqrt((xyz(2,1)-xyz(3,1))**2+(xyz(2,2)-xyz(3,2))**2+(xyz(2,3)-xyz(3,3))**2)
r(5)=sqrt((xyz(2,1)-xyz(4,1))**2+(xyz(2,2)-xyz(4,2))**2+(xyz(2,3)-xyz(4,3))**2)
r(6)=sqrt((xyz(3,1)-xyz(4,1))**2+(xyz(3,2)-xyz(4,2))**2+(xyz(3,3)-xyz(4,3))**2)

! Call EvdVdR to evaluate dVdR(6)
      Call EvU23O10dVdR(coord,r,dvdr)

! Call EvdRdX to evaluate dRdX(6,12)
      Call EvdRdX(coord,r,drdx)

! Calculate dVdX by using chain rule: dV/dXi=(dV/dRj)*(dRj/dXi), j=1 to 6
      do i=1,12
        do j=1,6
          dVdX(i)=dVdX(i) + dVdR(j)*dRdX(j,i)
        enddo
      enddo

      do i=1,12
          dVdX(i)=dVdX(i)/627.509474
      enddo

  call P_volume(xyz,volume)

! Now compute numerical dtdx
  call Num_dtdx(xyz,dtdx)

! Chain rule again, because U=tanh*V
! dUdX=dtanhdX*V+tanh*dVdX
do i=1,12
  dudx(i)=0
enddo

do i=1,12
  dudx(i)=dtdx(i)*s23+volume*dvdx(i)
enddo


! Assign dvdx back to du23dvdx
      do i=1,4
      do j=1,3
        k=3*(i-1)+j
        du23dx(i,j)=dudx(k)
      enddo
      enddo

      return

end subroutine u23_dvdx 

